Description:

The Naughtiest Nurses Of Coos County General Hospital Are At It Again!

Dr. Ben English has a hard enough time keeping his badly behaved staff in line. The added stress

of his sex-crazed daughter BiBi Jones humping everyone in the hospital is too much for his ticker!

Luckily Nurse Nikkita Von James knows mouth to mouth. Nurses Kayden Kross and Jesse Jane

are locked in a battle of wits vs tits all for the affections of Dr. Manuel Ferrara. Aspiring model

Nurse Riley Steele shows off her hottest moves for ultimate poser Erik Everhard, and curvaceous

patient Alexis Texas looks to Dr. James Deen to get to the bottom of her swollen booty all while the

staff is working 'round the clock to bring Selena Rose out of her coma. An orgy is just what the

doctor ordered!


